export default function Card(props)
{
    return(
        <div>
            <img src={props.content.company_logo} />
            <p>{props.content.company}</p>
            <ul>
                {props.content.keywords}
            </ul>
            <p>{props.content.location}</p>
            <p>{props.content.position}</p>
            <p>{props.content.postedOn}</p>
            <p>{props.content.timing}</p>
        </div>
    );
}
